import { makeAutoObservable } from "mobx";

export class GroupStorage {
    constructor() {
        this._groups = [
            {
                "id": 3,
                "name": "COOL NAME",
                "imageUrl": "https://avatars.mds.yandex.net/i?id=e708784c502029fd3580605e76109216_l-5761336-images-thumbs&n=27&h=480&w=480"
            },
            {
                "id": 4,
                "name": "COOL NAME",
                "imageUrl": "https://avatars.mds.yandex.net/i?id=e708784c502029fd3580605e76109216_l-5761336-images-thumbs&n=27&h=480&w=480"
            },
            {
                "id": 5,
                "name": "COOL NAME",
                "imageUrl": "https://avatars.mds.yandex.net/i?id=e708784c502029fd3580605e76109216_l-5761336-images-thumbs&n=27&h=480&w=480"
            }
        ];
        this._currentGroup = null; // Текущая просматриваемая группа
        this._groupPosts = []; // Посты в группе

        makeAutoObservable(this);
    }

    setGroups(groups) {
        this._groups = groups;
    }

    setUserGroups(groups) {
        this._userGroups = groups;
    }

    setCurrentGroup(group) {
        this._currentGroup = group;
    }

    setGroupPosts(posts) {
        this._groupPosts = posts;
    }

    get groups() {
        return this._groups;
    }

    get userGroups() {
        return this._userGroups;
    }

    get currentGroup() {
        return this._currentGroup;
    }

    get groupPosts() {
        return this._groupPosts;
    }
}
